import React, { useEffect, useState } from "react";
import axios from "axios";

const MoodList = () => {
  const [moods, setMoods] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Fetch mood data from the backend
    const fetchMoods = async () => {
      try {
        const response = await axios.get("http://localhost:5000/moods"); // Replace with your backend URL
        setMoods(response.data);
      } catch (err) {
        console.error("Error fetching moods:", err);
      } finally {
        setLoading(false);
      }
    };

    fetchMoods();
  }, []);

  if (loading) return <p>Loading...</p>;

  return (
    <div>
      <h2>Mood List</h2>
      {moods.length > 0 ? (
        <ul>
          {moods.map((mood) => (
            <li key={mood._id}>
              <h3>Mood: {mood.mood}</h3>
              <p>Message: {mood.message}</p>
              <p>Date: {new Date(mood.date).toLocaleString()}</p>
              <h4>Suggestions:</h4>
              <ul>
                {mood.suggestions.map((suggestion, index) => (
                  <li key={index}>{suggestion}</li>
                ))}
              </ul>
            </li>
          ))}
        </ul>
      ) : (
        <p>No mood data available.</p>
      )}
    </div>
  );
};

export default MoodList;
